import React, { useState, useEffect , Component} from 'react';
import axios from 'axios';
import Button from 'react-bootstrap/Button';
import Modal from 'react-bootstrap/Modal';
import Form from 'react-bootstrap/Form';

import '../pages/tenantDocuments.css';

function tenantDocuments(){

    return(
        <div className="container">
            <div className="row"> <h2> Tenant Lease Agreements </h2>  </div>

            <div className="row">
                <div className="col-6 currentLeaseAgreement"> 
                    <h4> Current Lease Agreement </h4> 
                    <span> Commencement date: </span>
                    <span> Expiry Date: </span>
                    <button className="btn btn-primary"> Renew Lease Agreement </button>
                </div>
                <div className="col-6 previousLeaseAgreements"> 
                    <h4> Previous Lease Agreements</h4>
                    <table className="table table-striped">
                        <thead className="thead-dark">
                            <tr>
                                <th> Start Date </th>
                                <th> End Date </th>
                                <th> Duration </th>
                                <th> Action </th>
                            </tr>
                        </thead>
                    </table> 
                </div>
            </div>

        </div>
    )

}

export default tenantDocuments;
